import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-contact',
  templateUrl: './contact.component.html',
  styleUrls: ['./contact.component.scss']
})
export class ContactComponent implements OnInit {

  constructor() { }

  ngOnInit(): void {
  }

}
<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8">
    <title>My Google Maps Demo</title>
    <style>
        /* Set the height of the map element */
        #map {
            height: 500px;
        }
    </style>
</head>
<body>
<!-- Add a div element to hold the map -->
<div id="map"></div>
<!-- Load the Google Maps API script -->
<script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyDv6NZftLo91TkC4GYHFyJfGW3Y_5q_j1s&callback=initMap"
        async defer></script>
<!-- Define the initMap function -->
<script>
    function initMap() {
        // Create a new map object
        var map = new google.maps.Map(document.getElementById('map'), {
            center: {lat: -34.397, lng: 150.644},
            zoom: 8
        });
    }
</script>
</body>
</html>
